import React from "react";
import styled from "styled-components";

const Navbar = () => {
  return
    <Nav>
        <NavContainer></NavContainer>
        <NavLogo>Logo</NavLogo>
        <MobileIcon></MobileIcon>
        <NavBarItems>
            <NavLink>Home</NavLink>
        </NavBarItems>
    </Nav>;
};

export default Navbar;
